// src/pages/Contact.js
import React, { useState } from 'react';
import './contact.css';  // Certifique-se de que o caminho está correto

const Contact = () => {
  const [formData, setFormData] = useState({
    name: '',
    email: '',
    message: ''
  });

  const handleChange = (e) => {
    const { name, value } = e.target;
    setFormData((prevState) => ({
      ...prevState,
      [name]: value
    }));
  };

  const handleSubmit = (e) => {
    e.preventDefault();
    console.log('Formulário enviado:', formData);
    setFormData({ name: '', email: '', message: '' });
  };

  return (
    <div className="contact-container">
      {/* Menu no topo */}
      <header className="header">
        <nav className="navbar">
          <ul>
            <li><a href="/dashboard">Dashboard</a></li>
            <li><a href="/events">Eventos</a></li>
            <li><a href="/contact">Contato</a></li>
            <li><a href="/register">Registrar</a></li>
          </ul>
        </nav>
      </header>

      <div className="contact-content">
        {/* Formulário de Contato */}
        <div className="contact-form-container">
          <form onSubmit={handleSubmit}>
            <div>
              <label>Nome</label>
              <input
                type="text"
                name="name"
                value={formData.name}
                onChange={handleChange}
                required
              />
            </div>
            <div>
              <label>E-mail</label>
              <input
                type="email"
                name="email"
                value={formData.email}
                onChange={handleChange}
                required
              />
            </div>
            <div>
              <label>Mensagem</label>
              <textarea
                name="message"
                value={formData.message}
                onChange={handleChange}
                required
              />
            </div>
            <button type="submit">Enviar</button>
          </form>
        </div>

        {/* Informações de Contato ao lado do formulário */}
        <div className="contact-info">
          <h2>Contato</h2>
          <div className="contact-details">
            <p><strong>Telefone:</strong> (11) 1234-5678</p>
            <p><strong>E-mail:</strong> contato@divulgame.com</p>
            <p><strong>Local:</strong> Rua Exemplo, 123 - São Paulo, SP</p>
          </div>

          {/* Redes Sociais */}
          <h3>Redes Sociais</h3>
          <div className="social-links">
            <p><a href="https://instagram.com/divulgame" target="_blank" rel="noopener noreferrer">Instagram</a></p>
            <p><a href="https://www.divulgame.com" target="_blank" rel="noopener noreferrer">Site Oficial</a></p>
          </div>
        </div>
      </div>

      {/* Rodapé */}
      <footer className="footer">
        <p>&copy; 2024 Divulgame. Todos os direitos reservados.</p>
      </footer>
    </div>
  );
};

export default Contact;
